default_options = {
    "currency": False,
    "ignoreDecimal": False,
    "ignoreZeroCurrency": False,
    "klisi": "onomastiki",
    "genos": "oudetero",
}


def remove_plus_minus_signs(num_string: str) -> str:
    after_removal = num_string
    if "-" in num_string:
        after_removal = num_string.replace("-", "")
    if "+" in num_string:
        after_removal = num_string.replace("+", "")
    return after_removal


def olografos(
    num: Union[int, float], options: Dict[str, Union[bool, str]] = default_options
) -> str:
    if not isinstance(num, (int, float)):
        raise TypeError("Number inserted is not of type number")
    final_string = ""
    options = dict(options)
    if not options.get("currency"):
        options["currency"] = False
    if not options.get("ignoreDecimal"):
        options["ignoreDecimal"] = False
    if not options.get("ignoreZeroCurrency"):
        options["ignoreZeroCurrency"] = False
    if not options.get("klisi"):
        options["klisi"] = "onomastiki"
    if not options.get("genos"):
        options["genos"] = "oudetero"

    if options["currency"]:
        options["genos"] = "oudetero"
    num_str = remove_plus_minus_signs(
        str(int(num)) if float(num).is_integer() else str(num).split(".")[0]
    )

    digits = data[options["genos"]][options["klisi"]]

    def up_to_three_digits(num: int) -> str:
        str_to_return = ""
        num_str = remove_plus_minus_signs(
            str(int(num)) if float(num).is_integer() else str(num).split(".")[0]
        )
        if len(num_str) == 3:
            str_to_return = f"{digits['tripleDigit'][int(num_str[0])]} {digits['singleOrDoubleDigit'][int(num_str[1:3])]}"
        if len(num_str) < 3:
            str_to_return = digits["singleOrDoubleDigit"][int(num_str)]
        return str_to_return

    def up_to_six_digits(num: int) -> str:
        str_to_return = ""
        num_str = remove_plus_minus_signs(
            str(int(num)) if float(num).is_integer() else str(num).split(".")[0]
        )
        if 3 < len(num_str) < 7:
            four_digit_string = ""
            if len(num_str) == 4 and num_str[0] == "1":
                four_digit_string = digits["thousand"]
            if len(num_str) == 4 and num_str[0] != "1":
                four_digit_number = num_str[0]
                four_digit_string = f"{digits['fourOrFiveDigits'][int(four_digit_number)]} {digits['thousands']}"
            if len(num_str) == 5:
                four_digit_number = num_str[0:2]
                four_digit_string = f"{digits['fourOrFiveDigits'][int(four_digit_number)]} {digits['thousands']}"
            if len(num_str) == 6:
                six_digit_number = num_str[0]
                four_digit_number = num_str[1:3]
                four_digit_string = f"{digits['sixDigits'][int(six_digit_number)]} {digits['fourOrFiveDigits'][int(four_digit_number)]} {digits['thousands']}"
            str_to_return = four_digit_string
        return str_to_return

    def up_to_nine_digits(num: int) -> str:
        str_to_return = ""
        num_str = remove_plus_minus_signs(
            str(int(num)) if float(num).is_integer() else str(num).split(".")[0]
        )
        if 6 < len(num_str) < 10:
            four_digit_string = ""
            if len(num_str) == 7 and num_str[0] == "1":
                four_digit_string = digits["million"]
            if len(num_str) == 7 and num_str[0] != "1":
                four_digit_number = num_str[0]
                four_digit_string = f"{digits['singleOrDoubleDigit'][int(four_digit_number)]} {digits['millions']}"
            if len(num_str) == 8:
                four_digit_number = num_str[0:2]
                four_digit_string = f"{digits['singleOrDoubleDigit'][int(four_digit_number)]} {digits['millions']}"
            if len(num_str) == 9:
                six_digit_number = num_str[0]
                four_digit_number = num_str[1:3]
                four_digit_string = f"{digits['tripleDigit'][int(six_digit_number)]} {digits['singleOrDoubleDigit'][int(four_digit_number)]} {digits['millions']}"
            str_to_return = four_digit_string
        return str_to_return

    def up_to_twelve_digits(num: int) -> str:
        str_to_return = ""
        num_str = remove_plus_minus_signs(
            str(int(num)) if (float(num)).is_integer() else str(num).split(".")[0]
        )
        if 9 < len(num_str) < 13:
            four_digit_string = ""
            if len(num_str) == 10 and num_str[0] == "1":
                four_digit_string = "ένα δις"
            if len(num_str) == 10 and num_str[0] != "1":
                four_digit_number = num_str[0]
                four_digit_string = (
                    f"{digits['singleOrDoubleDigit'][int(four_digit_number)]} δις"
                )
            if len(num_str) == 11:
                four_digit_number = num_str[0:2]
                four_digit_string = (
                    f"{digits['singleOrDoubleDigit'][int(four_digit_number)]} δις"
                )
            if len(num_str) == 12:
                six_digit_number = num_str[0]
                four_digit_number = num_str[1:3]
                four_digit_string = f"{digits['tripleDigit'][int(six_digit_number)]} {digits['singleOrDoubleDigit'][int(four_digit_number)]} δις"
            str_to_return = four_digit_string
        return str_to_return

    if num_str == "0":
        final_string = "μηδέν"
    if len(num_str) <= 3 and num_str != "0":
        final_string = up_to_three_digits(int(num)).strip()
    if 3 < len(num_str) <= 6:
        final_string = f"{up_to_six_digits(int(num_str))} {up_to_three_digits(int(num_str[-3:]))}".strip()
    if 6 < len(num_str) <= 9:
        final_string = f"{up_to_nine_digits(int(num_str))} {up_to_six_digits(int(num_str[-6:]))} {up_to_three_digits(int(num_str[-3:]))}".strip()
    if 9 < len(num_str) <= 12:
        final_string = f"{up_to_twelve_digits(int(num_str))} {up_to_nine_digits(int(num_str[-9:]))} {up_to_six_digits(int(num_str[-6:]))} {up_to_three_digits(int(num_str[-3:]))}".strip()
    if options["currency"]:
        final_string = f"{final_string} ευρώ"
    if "." in str(num) and not options["currency"]:
        float_str = str(num).split(".")[1]
        if len(float_str) == 1:
            float_str = str(num).split(".")[1] + "0"
        final_string = f"{final_string} και {data['oudetero'][options['klisi']]['singleOrDoubleDigit'][int(float_str[0:2])]} {data['oudetero'][options['klisi']]['floatHundreds']}"
    if "." in str(num) and options["currency"]:
        float_str = str(num).split(".")[1]
        if len(float_str) == 1:
            float_str = str(num).split(".")[1] + "0"
        final_string = f"{final_string} και {data['oudetero'][options['klisi']]['singleOrDoubleDigit'][int(float_str)]} {data['oudetero'][options['klisi']]['floatHundredsEuro']}"
    if "-" in str(num):
        final_string = f"μείον {final_string}"
    return final_string


